-- ----------------------------
--  Table structure for `sys_dict`
-- ----------------------------
DROP TABLE IF EXISTS `sys_dict`;
CREATE TABLE `sys_dict` (
  `id` varchar(32) NOT NULL,
  `value` varchar(100) NOT NULL COMMENT '字典值',
  `label` varchar(100) NOT NULL COMMENT '标签',
  `type` varchar(100) NOT NULL COMMENT '类型',
  `sort` int(3) NOT NULL COMMENT '排序',
  `description` varchar(100) DEFAULT NULL COMMENT '描述',
  `parent_id` varchar(32) NOT NULL COMMENT '父id',
  `create_by` varchar(32) NOT NULL COMMENT '创建者',
  `create_date` int(10) NOT NULL COMMENT '创建时间',
  `update_by` varchar(32) NOT NULL COMMENT '更新者',
  `update_date` int(10) NOT NULL COMMENT '更新时间',
  `remarks` varchar(255) DEFAULT NULL COMMENT '备注',
  PRIMARY KEY (`id`),
  UNIQUE KEY `PK_ID` (`id`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COMMENT='系统字典';

