-- ----------------------------
--  Table structure for `sys_log`
-- ----------------------------
DROP TABLE IF EXISTS `sys_log`;
CREATE TABLE `sys_log` (
  `id` varchar(32) NOT NULL,
  `title` varchar(100) NOT NULL COMMENT '操作菜单',
  `params` text NOT NULL COMMENT '操作参数',
  `exception` text COMMENT '异常信息',
  `request_uri` varchar(255) NOT NULL COMMENT '操作uri',
  `method` varchar(5) NOT NULL COMMENT '操作方法',
  `user_agent` varchar(255) NOT NULL,
