  `login_flag` char(1) NOT NULL COMMENT '是否允许登录:1-允许 0-拒绝',
  `page` int(3) DEFAULT '0' COMMENT '管理员分页值,可调整',
  `create_by` varchar(32) NOT NULL COMMENT '创建者',
  `create_date` int(10) NOT NULL COMMENT '创建时间',
  `update_by` varchar(32) NOT NULL COMMENT '更新者',
  `update_date` int(10) NOT NULL COMMENT '更新时间',
  `remarks` varchar(255) DEFAULT NULL COMMENT '备注',
  PRIMARY KEY (`id`),
  UNIQUE KEY `PK_ID` (`id`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COMMENT='系统用户';

